description:
Babysitter Diaries 16 (Split Scenes)
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Description: Cassidy decides to go sneaking around Jordan's house and ends up catching him naked in the shower. She gets so turned on that she can't help but watch, that is until Jordan catches her red handed.Natasha is desperate for a babysitting gig, so Manuel hires her for some help. When he comes home to find her sleeping on the couch, she knows there is only one way to make it up to him.Whitney is hired to help Mr. Pete out around the house, including taking care of him when he isn't feeling well. She knows exactly what kind of medicine he needs to get back in shape.Devious Piper decides to sneak her boyfriend into the house she is babysitting in for a little fun. They need to be careful though, too much noise might make them get caught!

Cast: Whitney Westgate, Natasha White, Cassidy Klein, Piper Perri, Manuel Ferrara, - (bio), Mr. Pete, Jordan Ash, Romeo Price, Bobby Manila,Director

